import React from "react";
import "./ParentProfile.css";

const parentProfile = () => {
  return (
    <div>
      <div className="parent-top">
        <ul>
          <li>Profile</li>
          <li>Notification Consent</li>
          <li>Children Details</li>
          <li>Authentication Details</li>
          <li>Review Details</li>
          <li>Completed</li>
        </ul>
      </div>
      <div className="parent-profile">
        <i class="fa-duotone fa-circle"></i>
        <h6>Profile Photo</h6>
      </div>
      <div className="parent-details">
        {/* <form action="/action_page.php"> */}
        <label for="Email">Email</label>
        <input type="email" id="email" placeholder="email" />
        <label for="Name">Name</label>
        <input type="name" id="name" placeholder="Name" name="name" />
        <label for="number">Contact No</label>
        <input type="number" id="number" placeholder="Contact No" name="number" />
        <label for="Name">Date Of Birth</label>
        <input type="name" id="name" placeholder="Name" name="name" />
        <input type="submit" value="Submit" />
        {/* </form> */}
        {/* <input type='Email' placeholder='email'>Email</input>
        <input type='Name' placeholder='Name'>Name</input>
        <input type='Contact No' placeholder='Contact No'>Contact No</input> */}
        {/* <input type='date of birth' placeholder='dd-mm-yyyy'>Date Of Birth</input> */}
      </div>
    </div>
  );
};

export default parentProfile;
